import React, { Fragment } from 'react';
import styled from 'styled-components';
import Link from './Link';

const NavItem = styled(Link)`
	display: inline-block;
	cursor: pointer;
	text-decoration: none;
	font-weight: bold;
	margin: 5px 45px;
	line-height: 16px;

	.white & {
		.icon-w, .icon-active {
			display: none;
		}
	}
	.black & {
		.icon-b, .icon-active {
			display: none;
		}
	}

`;

const NavCopy = styled.div`
	font-family: 'cera_proregular';
	color: #455051;
	.black & {
		color: #ffffff;
	}
`;

const navItem = (props) => (
	<Fragment>
		<NavItem to={'/' + props.type}>
			<img src={'assets/images/' + props.type + '.png'} alt={props.type} className="icon-b" />
			<img src={'assets/images/' + props.type + '_w.png'} alt={props.type} className="icon-w" />
			<img src={'assets/images/' + props.type + '_active.png'} alt={props.type} className="icon-active" />
			<NavCopy>{props.text}</NavCopy>
		</NavItem>
	</Fragment>
)

export default navItem;
